    {ntt"total": 4,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-09-27T02:00:03.896420",nt"name": "partial-pressure-or-fugacity-of-carbon-dioxide-dissolved-inorganic-carbon-temperature-salinity-e92a1",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0117725 includes Surface
    underway, chemical, meteorological and physical data collected from POLARSTERN in
    the English Channel, North Atlantic Ocean and South Atlantic Ocean from 1991-12-04
    to 1994-06-12 and retrieved during cruise ANT X/1A, ANT X6, ANT X8, ANT XI/1 and
    ANT XI/5. These data include AIR-SEA DIFFERENCE - PARTIAL PRESSURE (OR FUGACITY)
    OF CARBON DIOXIDE, BAROMETRIC PRESSURE, DISSOLVED INORGANIC CARBON (DIC), Partial
    pressure (or fugacity) of carbon dioxide - atmosphere, Partial pressure (or fugacity)
    of carbon dioxide - water, SALINITY, SEA SURFACE TEMPERATURE, WATER TEMPERATURE
    and WIND SPEED. The instruments used to collect these data include Carbon dioxide
    (CO2) gas analyzer and Shower head chamber equilibrator for autonomous carbon dioxide
    (CO2) measurement. These data were collected by Dorothee C. E. Bakker of University
    of East Anglia; School of Environmental Sciences as part of the ANT X/1A, ANT X6,
    ANT X8, ANT XI/1 and ANT XI/5 data set.",nt"license_title": null,nt"extras":
